void USR_CODER_Start()
{
	if ((is_started == false) && (is_power_on == true))
	{
		USR_CODER_Long(START_1, START_1_D);
		USR_CODER_Short(START_2, START_2_D);
		USR_CODER_Long(START_3, START_3_D);
		USR_CODER_Short(START_4, START_4_D);
		USR_CODER_Long(START_5, START_5_D);
		HAL_TIM_Base_Start_IT(&htim3);
		is_started = true;
	}
}

void USR_CODER_PowerOn()
{
	if (is_power_on == false)
	{
		USR_CODER_Long(POWER_ON_1, POWER_ON_1_D);
		USR_CODER_Short(POWER_ON_2, POWER_ON_2_D);
		is_power_on = true;
	}
}

void USR_CODER_PowerOff()
{
	if (is_power_on == true)
	{
		HAL_NVIC_DisableIRQ(EXTI0_IRQn);
		HAL_TIM_Base_Stop_IT(&htim3);
		HAL_TIM_IC_Stop_IT(&htim1, TIM_CHANNEL_4);
		USR_CODER_Long(POWER_OFF_1, POWER_OFF_1_D);
		USR_CODER_Short(POWER_OFF_2, POWER_OFF_2_D);
		is_power_on = false;
		is_triggered = false;
		is_started = false;
	}
}

void USR_CODER_TriggerOn()
{
	if ((is_triggered == false) && (is_started == true))
	{
		HAL_NVIC_DisableIRQ(TIM3_IRQn);
		HAL_NVIC_EnableIRQ(EXTI0_IRQn);
		USR_CODER_Long(TRIGGER_ON_1, TRIGGER_ON_1_D);
		USR_CODER_Short(TRIGGER_ON_2, TRIGGER_ON_2_D);
		HAL_NVIC_EnableIRQ(TIM3_IRQn);
		is_triggered = true;
	}
}

void USR_CODER_TriggerOff()
{
	if ((is_triggered == true)  && (is_started == true))
	{
		HAL_NVIC_DisableIRQ(TIM3_IRQn);
		HAL_NVIC_DisableIRQ(EXTI0_IRQn);
		HAL_TIM_IC_Stop_IT(&htim1, TIM_CHANNEL_4);
		USR_CODER_Long(TRIGGER_OFF_1, TRIGGER_OFF_1_D);
		USR_CODER_Short(TRIGGER_OFF_2, TRIGGER_OFF_2_D);
		HAL_NVIC_EnableIRQ(TIM3_IRQn);
		is_triggered = false;
	}
}

void USR_CODER_ChannelCode(uint8_t index)
{
	if ((is_triggered == false) && (is_started == true))
	{
		HAL_NVIC_DisableIRQ(TIM3_IRQn);
		HAL_NVIC_DisableIRQ(EXTI0_IRQn);
		USR_CODER_Long(CH_START, CH_START_D);
		USR_CODER_Short(CHANNELS_CODE[index], CH_D);
		HAL_NVIC_EnableIRQ(EXTI0_IRQn);
		HAL_NVIC_EnableIRQ(TIM3_IRQn);
	}
}

void USR_CODER_ChannelFreq(uint8_t channel, uint8_t index)
{
	if ((is_triggered == false) && (is_started == true))
	{
		HAL_NVIC_DisableIRQ(TIM3_IRQn);
		HAL_NVIC_DisableIRQ(EXTI0_IRQn);
		USR_CODER_Long(CHANNELS_FREQ_START[channel], CH_F_START_D);
		USR_CODER_Short(CHANNELS_FREQ[index], CHANNELS_FREQ_DELAY[index]);
		HAL_NVIC_EnableIRQ(EXTI0_IRQn);
		HAL_NVIC_EnableIRQ(TIM3_IRQn);
	}
}

void USR_CODER_Short(const uint16_t *code, uint16_t length)
{
	CODE_LEN = length;
	CODE_DATA = (uint16_t *)code;
	code_index = 0;
	HAL_TIM_Base_Start_IT(&htim2);
}

void USR_CODER_Long(uint16_t code, uint16_t delay)
{
	CODER_PORT->ODR = code;
	HAL_Delay(delay);
}

void USR_CODER_UdpHandler(uint8_t *udp_data)
{
	if (udp_data[1] == 'P') { USR_CODER_PowerOn(); }
	else if (udp_data[1] == 'p') { USR_CODER_PowerOff(); }
	else if (udp_data[1] == 'S') { USR_CODER_Start(); }
	else if (udp_data[1] == 'T') { USR_CODER_TriggerOn(); }
	else if (udp_data[1] == 't') { USR_CODER_TriggerOff(); }
	else if (udp_data[1] == 'C')
	{
		value = (udp_data[3] - '0') * 100 + (udp_data[4] - '0') * 10 + (udp_data[5] - '0');
		USR_CODER_ChannelCode(value);
	}
	else if (udp_data[1] == 'F')
	{
		value = (udp_data[3] - '0') * 100 + (udp_data[4] - '0') * 10 + (udp_data[5] - '0');
		ch = udp_data[2] - '0';
		USR_CODER_ChannelFreq(ch, value);
	}
}

